ti, urediti, ili obrisati svoje osobne podatke u bilo koje vrijeme (samo ne mogu promijeniti svoje korisničko ime). Administratori web-stranice također mogu vidjeti i uređivati te informacije.','How long we retain your data'=>'Koliko dugo čuvamo vaše podatke','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'Ako uredite ili objavite članak, dodatni kolačić će biti spremljen u vašem pregledniku. Taj kolačić ne sadrži osobne podatke i samo ukazuje na ID objave članka koji ste upravo uredili. Kolačić istječe nakon jednog dana.','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'Ako imate račun na ovoj web-stranici, ili ste pisali komentare, možete zatražiti primanje izvozne datoteke osobnih podataka koje imamo o vama, uključujući sve podatke koje ste nam dostavili. Također možete zatražiti brisanje svih osobnih podataka koje imamo o vama. Ovo ne uključuje bilo koje podatke koje smo obavezni držati za administrativne, pravne ili sigurnosne namjene.','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'Ako napišete komentar na našoj web-stranici, možete odabrati spremanje imena, adrese e-pošte i web-stranice u kolačiće. To vam olakšava ponovno komentiranje, da ne morate opet unositi te informacije. Ovi kolačići traju godinu dana.','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'Ako napišete komentar, komentar i njegovi meta podaci su sačuvani zauvijek. To je zato da možemo automatski prepoznati i odobriti buduće komentare, umjesto da ih držimo na čekanju za odobrenje.','If you request a password reset, your IP address will be included in the reset email.'=>'Ako zatražite ponovno postavljanje lozinke, vaša IP adresa bit će uključena u poruku e-pošte za ponovno postavljanje.','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'Ako prenesete sliku na web-stranicu, trebali biste izbjegavati prijenos slika koje imaju ugrađene podatke o lokaciji (EXIF GPS). Posjetitelji web-stranice mogu ih preuzeti i izdvojiti bilo koje podatke o lokaciji iz slika s web-stranice.','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.'=>'Ako posjetite našu stranicu za prijavu, postavit ćemo privremeni kolačić kako bismo utvrdili prihvaća li vaš preglednik kolačiće. Ovaj kolačić ne sadrži osobne podatke i briše se kada zatvorite preglednik.','Install from Google Fonts. Fonts are copied to and served from your site.'=>'Instaliraj iz Google fontova. Fontovi se kopiraju i poslužuju s vaše web-stranice.','Introduce yourself.'=>'Predstavi se.','Media'=>'Medij','Multi-column patterns with more complex layouts.'=>'Uzorci s više stupaca sa složenijim izgledima.','Once Daily'=>'Jednom dnevno','Once Hourly'=>'Jednom u satu','Once Weekly'=>'Jednom tjedno','Our website address is: %s.'=>'Adresa naše web-stranice je: %s.','Patterns containing mostly text.'=>'Uzorci koji sadrže uglavnom tekst.','Patterns that contain buttons and